import path from 'path';
import merge from 'webpack-merge';

export const general = {
  resolve: {
    modules: [path.join(__dirname, '../src'), path.join(__dirname, 'src'), 'node_modules'],
    extensions: ['.js', '.ts', '.tsx'],
  },
  mode: 'production',
  optimization: {
    splitChunks: {
      cacheGroups: {
        vendor: {
          test: /[\\/]node_modules[\\/]/,
          name: 'vendor',
          chunks: 'all',
